		    wallNutLoadingText.x = wallNutLoading.x + 25;
		    wallNutLoadingText.y = wallNutLoading.y + 20;
		    wallNutLoadingText.alpha = 0;
		    cardTextContainer.addChild(wallNutLoadingText);
